import React, { useState } from 'react';
import BotsPage from './components/BotsPage';

function App() {
  const [enlistedBots, setEnlistedBots] = useState([]); // Declare enlistedBots state

  const handleEnlist = (bot) => {
    setEnlistedBots((prevEnlistedBots) => [...prevEnlistedBots, bot]);
  };

  // Rest of the code...

  return (
    <div>
      <h1>Welcome to Bot Battlr</h1>
      <BotsPage onEnlist={handleEnlist} enlistedBots={enlistedBots} />
    </div>
  );
}

export default App;
